import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { Button } from "@shadcn/ui"; // Keeping only this import

import "./styles.css";

// Import images
import dsImage from "./assets/What-is-data-science-2.jpg";
import aimlImage from "./assets/aiml-image-1.webp";
import cyberImage from "./assets/cyber-image.png";
import bbaImage from "./assets/images-bba.jpg";
import heroBackground from "./assets/diverse-group-students-interacting-21860865.webp";
import aboutImage from "./assets/introduction.png";

const HomePage = () => {
  const navigate = useNavigate();
  const [animate, setAnimate] = useState(false);

  useEffect(() => {
    setAnimate(true);
  }, []);

  const specializations = [
    { name: "Data Science", image: dsImage, path: "/alumni/datascience" },
    { name: "AI / ML", image: aimlImage, path: "/alumni/aiml" },
    { name: "Cybersecurity", image: cyberImage, path: "/alumni/cyber" },
    { name: "BBA", image: bbaImage, path: "/alumni/bba" },
  ];

  return (
    <div className="homepage">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="container navbar-container">
          <div className="logo" onClick={() => navigate("/")}>
            Alumni Edge
          </div>
          <div className="nav-links">
            <Button onClick={() => navigate("/")}>Home</Button>
            <Button onClick={() => navigate("/alumni")}>For Alumni</Button>
            <Button onClick={() => navigate("/student")}>For Students</Button>
            <Button className="btn-secondary">Sign In</Button>
          </div>
        </div>
      </nav>

      {/* Hero Section */}
      <header
        className="hero"
        style={{
          backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.6), url(${heroBackground}))`,
        }}
      >
        <div className="container hero-content">
          <h1 className="hero-title">
            Connect With <span className="text-primary">Industry Leaders</span>
          </h1>
          <p className="hero-subtitle">
            Learn from alumni who've walked the same path before you
          </p>
          <div className="hero-buttons">
            <Button onClick={() => navigate("/alumni")} className="btn-primary">
              I'm an Alumni
            </Button>
            <Button onClick={() => navigate("/student")} className="btn-secondary">
              I'm a Student
            </Button>
          </div>
        </div>
      </header>

      {/* About Section */}
      <section className="about">
        <div className="container about-container">
          <div className="about-content">
            <h2>About Alumni Edge</h2>
            <p>
              Our platform bridges the gap between current students and
              successful alumni...
            </p>
          </div>
          <div className="about-image">
            <img src={aboutImage} alt="Introduction" />
          </div>
        </div>
      </section>

      {/* Specializations Section */}
      <section className="specializations">
        <div className="container">
          <h2>Explore by Specialization</h2>
          <div className="spec-grid">
            {specializations.map((spec, index) => (
              <div key={index} className="spec-card" onClick={() => navigate(spec.path)}>
                <img src={spec.image} alt={spec.name} className="spec-image" />
                <h3>{spec.name}</h3>
                <Button className="spec-button">View Alumni</Button>
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
